import React from "react";

function handleSave() {}
const MovieForm = ({ match }) => {
  return (
    <React.Fragment>
      <h1>Movie Form {match.params.id} </h1>
      <button>Save</button>
    </React.Fragment>
  );
};

export default MovieForm;
